import React, {useEffect, useState} from "react";

function About () {
    return(
      <div className="container-about">
          <div className="title">
          <h1>About Us</h1>
          </div>
          <div classname="history">
            <p>this is our history</p>
          </div>
      </div>
    );
}

export default About;
